impl Solution {
    pub fn number_of_beautiful_integers(low: i32, high: i32, k: i32) -> i32 {
        (low..=high)
            .filter(|&num| num % k == 0 && Solution::is_beautiful(num))
            .count() as i32
    }

    fn is_beautiful(num: i32) -> bool {
        let digits = num.to_string();
        let (even, odd) = digits.chars().fold((0, 0), |(even, odd), c| {
            if c.to_digit(10).unwrap() % 2 == 0 {
                (even + 1, odd)
            } else {
                (even, odd + 1)
            }
        });
        even == odd
    }
}
